import React from 'react';
import styled from 'styled-components';


const  Wapper = styled.button`

    width: 150px;
    margin-left: 170px;
    margin-top: 60px;

`

const Button = ({
    onClick,
    name
}) => (

      <Wapper>{name}</Wapper>
)

export default Button;
